import React from 'react';
import { Link } from "react-router-dom";
import styles from './index.module.css';

const MainPage = () => {
    return (
        <body >
            <div class={styles.float-container}>

                <div class={styles.float-child}>
                    <div class="green">
                        <Link to="/pathfinder">Star Wars</Link>
                    </div>
                </div>

                <div class={styles.float-child}>
                    <div class="blue">
                        <Link to="/pathdragon">Dragon Ball</Link>
                    </div>
                </div>

            </div>
        </body>
    )
};

export default MainPage;
